goog.provide("goog.fx.css3");goog.require("goog.fx.css3.Transition");goog.fx.css3.fade=function(element,duration,timing,startOpacity,endOpacity){return new goog.fx.css3.Transition(element,duration,{opacity:startOpacity},{opacity:endOpacity},{property:"opacity",duration:duration,timing:timing,delay:0})};goog.fx.css3.fadeIn=function(element,duration){return goog.fx.css3.fade(element,duration,"ease-out",0,1)};goog.fx.css3.fadeOut=function(element,duration){return goog.fx.css3.fade(element,duration,"ease-in",1,0)};